import React from 'react'

function NewCard({newWork}) {
  const   {medium, 
          artist, 
          title, 
          date, 
          image} = newWork

  return (
    <li className="card">
      {image = "" ? <img src={image} alt={artist}/> : <img src="https://publicdelivery.org/wp-content/uploads/2019/09/Rene%CC%81-Magritte-%E2%80%93-The-Treachery-of-Images-This-is-Not-a-Pipe-1929--scaled.jpg" alt="pipe"/> }
      <h4>{artist}</h4>
      <p className="title">{title}</p>
      <p>{date}</p>
      <p>{medium}</p>
    </li>
  )
}



export default NewCard
